import React from 'react';

const Card = (props) => {
    const {name,email} = props;
    return (

        <div className='tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5'>
             <h1>ROBO FRIENDS</h1>
            <img alt='img' src ={`https://robohash.org/${props.id}?200x200`} />
            <div>
                <h2>
                    {name}

                </h2>
                <p>{email}</p>
            </div>
        </div>
    );

}

export default Card;
